DROP TABLE IF EXISTS `test_area_name`;
CREATE TABLE `test_area_name` (
  `lang`                  varchar(32) not null comment '语言',
  `area_name`             varchar(100) not null comment '地区名称',
  `area_code`             varchar(32) not null comment '地区编码',
  `type`                  varchar(32) not null comment '类型',
  `is_edit`               varchar(32) comment '是否编辑：0否，1是',
  `remarks`               varchar(32) comment '备注'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='地区名称信息表';

